import React from "react";
import { Link } from "react-router-dom";

function Nav() {
  return (
    <React.Fragment>
    <Link to="/" className="books-back">
    <nav className="navbar">
      <a className="navbar-brand" href="/">
        Google Reads!
      </a>
    </nav>
    </Link>
    <Link to="/path1" className="books-back">
    </Link>
    <Link to="/path2" className="detail-back">
    <nav className="navbar">
      <a className="navbar-brand" href="/">
        Google Reads!
      </a>
    </nav>
    </Link>
    </React.Fragment>
  );
}

export default Nav;
